  "translationLines": [
    {
      "lineNumber": 95891,
      "originalJapaneseLine": "「いや、ランスの奴がまた無茶言ってるらしい。",
      "translatedEnglishLine": "\"No, it seems that Rance is making unreasonable demands again.\""
    },
    {
      "lineNumber": 95892,
      "originalJapaneseLine": "　ヘルマンには影響がないが……",
      "translatedEnglishLine": "It doesn't affect Helman, but..."
    },
    {
      "lineNumber": 95893,
      "originalJapaneseLine": "　予算がかなり吹っ飛んだってよ」",
      "translatedEnglishLine": "The budget has been blown away quite a bit.\""
    },
    {
      "lineNumber": 95894,
      "originalJapaneseLine": "「平時なら、",
      "translatedEnglishLine": "\"In peacetime,"
    },
    {
      "lineNumber": 95895,
      "originalJapaneseLine": "　即総統の座から引きずり下ろされてるな」",
      "translatedEnglishLine": "he would have been immediately dragged down from the position of supreme leader.\""
    },
    {
      "lineNumber": 95896,
      "originalJapaneseLine": "「それは……ランス様らしいですね……」",
      "translatedEnglishLine": "\"Well… that sounds just like Lord Rance…\""
    },
    {
      "lineNumber": 95897,
      "originalJapaneseLine": "「らしい、で済ませられる額じゃないぞ。",
      "translatedEnglishLine": "\"It's not an amount that you can just pass off as 'just like him.'"
    },
    {
      "lineNumber": 95898,
      "originalJapaneseLine": "　ったく、あの男は……」",
      "translatedEnglishLine": "Damn that man...\""
    },
    {
      "lineNumber": 95899,
      "originalJapaneseLine": "「あの……」",
      "translatedEnglishLine": "\"Um...\""
    },
    {
      "lineNumber": 95900,
      "originalJapaneseLine": "「んん？」",
      "translatedEnglishLine": "\"Hmm?\""
    },
    {
      "lineNumber": 95901,
      "originalJapaneseLine": "「ヒューバートさんは……",
      "translatedEnglishLine": "\"Hubert-san…"
    },
    {
      "lineNumber": 95902,
      "originalJapaneseLine": "　ランス様のこと、どうお思いですか？」",
      "translatedEnglishLine": "what do you think about Lord Rance?\""
    },
    {
      "lineNumber": 95903,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 95904,
      "originalJapaneseLine": "「あーうー……」",
      "translatedEnglishLine": "\"Ah—uh...\""
    },
    {
      "lineNumber": 95905,
      "originalJapaneseLine": "「ガキの頃以来だな……",
      "translatedEnglishLine": "\"It's been since I was a kid..."
    },
    {
      "lineNumber": 95906,
      "originalJapaneseLine": "　そういう答えにくい質問は……」",
      "translatedEnglishLine": "that I've been asked such a difficult question to answer...\""
    },
    {
      "lineNumber": 95907,
      "originalJapaneseLine": "「むかぁーし、赤ちゃんはどこから来るのって",
      "translatedEnglishLine": "\"Even more difficult than when I was asked long ago where babies come from."
    },
    {
      "lineNumber": 95908,
      "originalJapaneseLine": "　聞かれた時よりも答えにくいぞ」",
      "translatedEnglishLine": "\""
    },
    {
      "lineNumber": 95909,
      "originalJapaneseLine": "「ええっ、私、そんなこと……」",
      "translatedEnglishLine": "\"Eh, I—I didn’t mean that...\""
    },
    {
      "lineNumber": 95910,
      "originalJapaneseLine": "「お互いに立場があるから……",
      "translatedEnglishLine": "\"Because we both have our positions..."
    },
    {
      "lineNumber": 95911,
      "originalJapaneseLine": "　簡単には答えられないが……」",
      "translatedEnglishLine": "I can’t answer lightly...\""
    },
    {
      "lineNumber": 95912,
      "originalJapaneseLine": "「ま、すげー奴だよな。",
      "translatedEnglishLine": "\"Well, he’s an incredible guy."
    },
    {
      "lineNumber": 95913,
      "originalJapaneseLine": "　そこは間違いねぇ」",
      "translatedEnglishLine": "There’s no mistake about that.\""
    },
    {
      "lineNumber": 95914,
      "originalJapaneseLine": "「ただ……",
      "translatedEnglishLine": "\"But..."
    },
    {
      "lineNumber": 95915,
      "originalJapaneseLine": "「尊敬は出来ねーなぁ……」",
      "translatedEnglishLine": "I just can’t respect him...\""
    },
    {
      "lineNumber": 95916,
      "originalJapaneseLine": "「あう……」",
      "translatedEnglishLine": "\"Aww...\""
    },
    {
      "lineNumber": 95917,
      "originalJapaneseLine": "「立場の違う数年前なら、",
      "translatedEnglishLine": "\"A few years ago, when our positions were different,"
    },
    {
      "lineNumber": 95918,
      "originalJapaneseLine": "　案外無邪気にあいつの奔放さを",
      "translatedEnglishLine": "I might have innocently envied his free-spiritedness,"
    },
    {
      "lineNumber": 95919,
      "originalJapaneseLine": "　羨ましく思ったかも知れねぇけどな」",
      "translatedEnglishLine": "surprisingly so.\""
    },
    {
      "lineNumber": 95920,
      "originalJapaneseLine": "それまでの軽い口調を抑え、",
      "translatedEnglishLine": "Suppressing his previously light tone,"
    },
    {
      "lineNumber": 95921,
      "originalJapaneseLine": "ヒューバートが顔を引き締める。",
      "translatedEnglishLine": "Hubert tightened his expression."
    },
    {
      "lineNumber": 95922,
      "originalJapaneseLine": "「だが、今俺は国を背負ってる」",
      "translatedEnglishLine": "\"But now I carry the responsibility of the country.\""
    },
    {
      "lineNumber": 95923,
      "originalJapaneseLine": "「武人や将軍ならともかく、国をまとめる人間が、",
      "translatedEnglishLine": "\"Though it might be different for a soldier or general, a person who unites the country,"
    },
    {
      "lineNumber": 95924,
      "originalJapaneseLine": "　あれを手本にしちゃあいかんだろ」",
      "translatedEnglishLine": "cannot take that as an example.\""
    },
    {
      "lineNumber": 95925,
      "originalJapaneseLine": "「ま、目が離せなくなる奴だってのは、",
      "translatedEnglishLine": "\"Well, I do admit he’s someone you can’t take your eyes off,"
    },
    {
      "lineNumber": 95926,
      "originalJapaneseLine": "　俺も納得してるとこではあるがな」",
      "translatedEnglishLine": "that much I agree with.\""
    },
    {
      "lineNumber": 95927,
      "originalJapaneseLine": "「少なくとも、今回の戦争は、",
      "translatedEnglishLine": "\"At least, for this war,"
    },
    {
      "lineNumber": 95928,
      "originalJapaneseLine": "　あいつに任せる以外ない」",
      "translatedEnglishLine": "there’s no one but him to entrust it to.\""
    },
    {
      "lineNumber": 95929,
      "originalJapaneseLine": "「俺に出来ることがあれば、",
      "translatedEnglishLine": "\"If there’s anything I can do,"
    },
    {
      "lineNumber": 95930,
      "originalJapaneseLine": "　なんでもする気だぜ」",
      "translatedEnglishLine": "I’m willing to do anything.\""
    },
    {
      "lineNumber": 95931,
      "originalJapaneseLine": "「…………はい」",
      "translatedEnglishLine": "\"...Yes.\""
    },
    {
      "lineNumber": 95932,
      "originalJapaneseLine": "「――ってな話はあいつには言うなよ」",
      "translatedEnglishLine": "\"—Don’t tell him about this kind of talk.\""
    },
    {
      "lineNumber": 95933,
      "originalJapaneseLine": "「調子に乗るからな」",
      "translatedEnglishLine": "\"He’ll get cocky.\""
    },
    {
      "lineNumber": 95934,
      "originalJapaneseLine": "「くすくす、分かりました」",
      "translatedEnglishLine": "\"Heh heh, understood.\""
    },
    {
      "lineNumber": 95935,
      "originalJapaneseLine": "「別に俺はアイツを",
      "translatedEnglishLine": "\"I’m not exactly hating that guy or anything, so don’t worry.\""
    },
    {
      "lineNumber": 95936,
      "originalJapaneseLine": "　嫌ってるわけじゃないから心配すんなって」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 95937,
      "originalJapaneseLine": "ヒューバートがシーラの頭を",
      "translatedEnglishLine": "Hubert ruffled Sheila’s head."
    },
    {
      "lineNumber": 95938,
      "originalJapaneseLine": "くしゃりと撫でる。",
      "translatedEnglishLine": "He stroked it ruffly."
    },
    {
      "lineNumber": 95939,
      "originalJapaneseLine": "「あ、お見通しだったんですね……」",
      "translatedEnglishLine": "\"Ah, you saw right through me...\""
    },
    {
      "lineNumber": 95940,
      "originalJapaneseLine": "図星を突かれ、",
      "translatedEnglishLine": "Hit right on the mark,"
    }
  ]
}

